Here is a sample implementation of a Chrome extension that takes screenshots of the current tab and saves them to a folder on your computer:

1. Create a new Chrome extension project in your favorite IDE or text editor. You can follow the official documentation to get started: https://developer.chrome.com/docs/extensions/mv3/getstarted/

2. In the manifest.json file, add the following permissions:
```
"permissions": [
  "activeTab",
  "storage",
  "tabs"
],
```
3. In the background.js file, add the following code to take a screenshot of the current tab and save it to a folder on your computer:
```
chrome.tabs.query({active: true, currentWindow: true}, function(tabs) {
  chrome.tabs.captureVisibleTab(null, {}, function(dataUrl) {
    var filename = "screenshot-" + Date.now() + ".png";
    var folder = "screenshots";
    chrome.storage.sync.set({folder: folder}, function() {
      chrome.downloads.download({
        url: dataUrl,
        filename: filename,
        saveAs: false,
        conflictAction: "overwrite"
      });
    });
  });
});
```
